<p>由于课程细节会进行 <em>无预告</em> 更新，因此你需要时常查阅官网并关注来自项目、学系、学院、学校的邮箱来确认是否发生了最新的变化（<a href="/MScBIS/Tech/it_services.html" target="_blank">CityU邮箱地址</a>）</p>
